import React, { Component } from 'react';
import Post from './Post';

export default class Posts extends Component {
    render() {
        return (
            <div className="left">
                <Post src="https://i.kym-cdn.com/entries/icons/original/000/018/385/Rs_634x1024-130605092844-634.DespMe2.mh.060513.jpg" alt="inst"/>
                <Post src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT-TjDxbTcq4z1dgQ0QxlrKQI9MpcertHAQ2g&usqp=CAU" alt="second"/>
            </div>
        )
    }
}
